INSERT INTO `car_notice` (`id`, `notice`) VALUES (1, '<p style=\\\"color:#191919;font-family:&amp;font-size:100%;font-style:normal;font-weight:400;margin-left:0px;text-align:left;text-decoration:none;text-indent:0px;\\\"><span style=\\\"font-size:16px;\\\">1.</span><span style=\\\"font-size:16px;\\\">至少提前两周预约</span><span style=\\\"font-size:16px;\\\">，<span style=\\\"font-size:100%;\\\">预</span>约确定以支付定金为准，定金20元(不可退)；拍照排期以收到定金顺序为准。</span></p><span style=\\\"background-color:#FFFFFF;color:#191919;font-family:&quot;font-size:16px;font-style:normal;font-weight:400;line-height:1.9;text-decoration:none;\\\"></span><p style=\\\"color:#191919;font-family:&amp;font-size:100%;font-style:normal;font-weight:400;margin-left:0px;text-align:left;text-decoration:none;text-indent:0px;\\\"><span style=\\\"font-size:16px;\\\">2.检车余款于拍照当日结清：支付宝／微信／现金均可。</span></p><span style=\\\"background-color:#FFFFFF;color:#191919;font-family:&quot;font-size:16px;font-style:normal;font-weight:400;line-height:1.9;text-decoration:none;\\\"> </span><p style=\\\"color:#191919;font-family:&amp;font-size:100%;font-style:normal;font-weight:400;margin-left:0px;text-align:left;text-decoration:none;text-indent:0px;\\\"><span style=\\\"font-size:16px;\\\">3.如遇个人原因临时变更，请于原定拍摄时间提前<span style=\\\"font-size:100%;\\\">至少48小时</span>与我联系更改，感谢理解；预约当天无特殊理由取消，订单作废，再次预约重付20元定金。</span></p>');
