INSERT INTO `hospital_registration` (`id`, `hospital_name`, `brief`, `level`, `img_url`) VALUES (1, '大连市儿童医院', '大连市儿童医院创建于1952年6月1日，经过几代儿医人的艰苦奋斗，已成长为一所学科门类齐全、师资力量雄厚、医疗技术精湛、诊疗设备先进的辽宁省规模最大的综合性儿童医院。担负着辽东半岛18岁以下儿童的医疗、预防、康复、保健任务。2013年2月6日，签约成为大连医科大学附属大连市儿童医院。系国家儿科、儿外科住院医师规范化培训基地，辽宁省首批儿科、儿外科住院医师规范化培训基地。医院设有36个学科，大连市快速提升医疗软实力建设项目小儿心脏病诊疗基地1个，大连市一级医学重点学科6个。', '3', '/profile/2020/10/27/h1.jpg');
INSERT INTO `hospital_registration` (`id`, `hospital_name`, `brief`, `level`, `img_url`) VALUES (2, '大连市中山医院', '大连大学附属中山医院(沈阳铁路局大连医院)创建于1907年,是一所集医疗、教学、科研为一体的综合性大学附属医院。占地面积九万余平方米,建筑面积七万余平方米', '5', '/profile/2020/10/27/h2.jpg');
