INSERT INTO `house_source` (`id`, `source_name`, `address`, `area_size`, `tel`, `price`, `house_type`, `pic`, `desc`) VALUES (1, '泉水B6区泉水小学北站附近多层一室一厅得房率高\n', '泉水B6区泉水小学北站附近多层一室一厅得房率高', 52, '18546474545', '16262/㎡', '1', '/profile/cshi.jpg', '房主现在比较着急 房子如果真看好的话 价格可议 手续这边齐全 房子没有抵押 产权证在手 随时配合过户 房主现在已经搬走了 房子现在是空置状态');
INSERT INTO `house_source` (`id`, `source_name`, `address`, `area_size`, `tel`, `price`, `house_type`, `pic`, `desc`) VALUES (2, '西安路08年框架电梯房 70年LOFT 一室一厅封闭小区', '西安路08年框架电梯房 70年LOFT 一室一厅封闭小区', 88, '18546474547', '28300/㎡', '1', '/profile/xweb.jpg', '第五郡经典一室小房好楼层自住保持非常好小区一共36栋楼,8栋小高,28栋洋,小区绿树');
INSERT INTO `house_source` (`id`, `source_name`, `address`, `area_size`, `tel`, `price`, `house_type`, `pic`, `desc`) VALUES (3, '大华实验双学 区长江路 好楼层 单价超低 看房方便', '数码路118号', 100, '18546474549', '21000/㎡', '1', '/profile/xwen1.jpg', '我去看过这个房子，位置好，不挡光，中间楼层，精装修赠送全部家具家电，拎包即住，看房方便，照片视频等都是实景拍摄，欢迎随时咨询。');
INSERT INTO `house_source` (`id`, `source_name`, `address`, `area_size`, `tel`, `price`, `house_type`, `pic`, `desc`) VALUES (4, '万达金石天成，首付10万，精装婚房，即买即住，随时看房。', '高新区万达广场', 88, '18546474543', '1500/月', '2', '/profile/xwen3.jpg', '房子是外走廊的，桥北不过道，离金三小学很近，真便宜，65万！看好还能谈！1、房子的地角非常好，在金三小学北侧不足百米，位置安静，无坡，出行方便，生活便利。2、是4楼的房子，楼间距大，采光好！3、一室户型，南北向，通风好，居住舒适。4，简单的装修，保持的干净利索，户型标准！');
INSERT INTO `house_source` (`id`, `source_name`, `address`, `area_size`, `tel`, `price`, `house_type`, `pic`, `desc`) VALUES (5, '金二76中双重点学 区 小面积总房款低 三楼楼层好', '华东路288号', 122, '18546474548', '2000/月', '2', '/profile/home2.png', '房型正气，户型为南北通厅，客厅朝南，有大落地窗另赠送约6平米外置阳台，不算产权证面积，南卧室，精装修。没有一点浪费面积，得房率高达83%。全明户型，采光好。');
INSERT INTO `house_source` (`id`, `source_name`, `address`, `area_size`, `tel`, `price`, `house_type`, `pic`, `desc`) VALUES (6, '中芥费三千第五郡 1室2厅 南北通透 56平居家自住 保养好', '中山路南路118号', 112, '18546474534', '18200/㎡', '3', '/profile/timg.jpg', '交通：轻轨3号线，大连开发区至金石滩中巴，金石滩区内公交。幼儿园：香港伟才幼儿园，小学：金石滩实验小学中学：金石滩实验中学，金石滩十三中，枫叶初中，枫叶高中。大学：鲁美，沈阳音乐学院，大连民族大学。');
INSERT INTO `house_source` (`id`, `source_name`, `address`, `area_size`, `tel`, `price`, `house_type`, `pic`, `desc`) VALUES (7, '精装loft，一居室，配套完善，单身青年看过来，你该脱单了', '联合路65号', 97, '18546474521', '21200/㎡', '3', '/profile/d14305b1-960a-4901-a4ef-b32f5a7c33ef.jpg', '交通：轻轨3号线，大连开发区至金石滩中巴，金石滩区内公交。幼儿园：香港伟才幼儿园，小学：金石滩实验小学中学：金石滩实验中学，金石滩十三中，枫叶初中，枫叶高中。大学：鲁美，沈阳音乐学院，大连民族大学。');
