INSERT INTO `job_company` (`id`, `company_name`, `introductory`) VALUES (1, '新型技术公司', '根据发布的第二份年度十大新兴技术报告，物联网是一种新兴技术，为创造新的业务和收入提供了最大的机会。\n报告中提到的10项技术根据每家为IT公司和其他商业技术公司创建的近期业务和财务机会进行排名。\n');
INSERT INTO `job_company` (`id`, `company_name`, `introductory`) VALUES (2, '左培互联网有限公司', '是一家新型互联网公司，集互联网高科技与艺术设计为一体，帮客户做产品，做自己的产品，一直执着的追求极致产品；');
INSERT INTO `job_company` (`id`, `company_name`, `introductory`) VALUES (3, '虎鱼科技', '营收和利润的主要来源是商用POS机,智能POS机，智能POS称，肉菜追溯批发自助交易终端，智能印章管理系统');
INSERT INTO `job_company` (`id`, `company_name`, `introductory`) VALUES (4, '恒但科技公司', '恒但科技始终坚持“踏实、诚信、合作、创新”的经营理念，全面贯彻“一切以客户为中心”的营销理念作为公司的服务宗旨，与合作伙伴一起，创造更美好的明天。 ');
INSERT INTO `job_company` (`id`, `company_name`, `introductory`) VALUES (5, '牙大夫', '守望口腔汇聚了国内外优秀的医疗人才，采用“四手”操作，执行严格的消毒规范，为患者提供安心、安全的治疗环境。诊所内设有典雅舒适、风格各异的独立诊疗室，为患者提供一个轻松温馨的诊疗氛围');
