INSERT INTO `job_post` (`id`, `company_id`, `contacts`, `name`, `obligation`, `address`, `need`, `salary`, `profession_id`) VALUES (2, '5', '王女士', '医生助理五险一金双休', '辅助医生参与患者治疗和管理', '大连市沙河口区中山路', '工作经验1-2年', '5000', '5');
INSERT INTO `job_post` (`id`, `company_id`, `contacts`, `name`, `obligation`, `address`, `need`, `salary`, `profession_id`) VALUES (3, '4', '李先生', '平面设计师（包吃住）', '能够高效的完成平面设计，排版设计，图文海报设计，宣传单名片设计，画册设计，要求具有良好的审美能力，一次成稿率较高，视觉传达专业毕业优先。公司下设设计部，工作职责是：为客户提供设计服务。', '大连 - 高新园区 - 黄浦路', '工作经验1-2年', '6000', '2');
INSERT INTO `job_post` (`id`, `company_id`, `contacts`, `name`, `obligation`, `address`, `need`, `salary`, `profession_id`) VALUES (4, '2', '张先生', '五险一金+6k英语老师', '外语教师:一、从事3到12岁少儿英语教学，以游戏活动方式进行英文式授课，授课英语课程对话单词歌曲等，\r\n二、负责将学生的学习情况与家长保持积极的沟通，并给予耐心的指导，三、配合学校定期举办的各项活动，', '大连 - 中山 - 迎宾路', '工作经验1-2年', '8000', '3');
INSERT INTO `job_resume` (`id`, `most_education`, `education`, `address`, `experience`, `individual_resume`, `money`, `position_id`, `user_id`, `files`) VALUES (1, '博士', '本科', '天龙人2222', '1年', '性格有点内向、乐观上进、有爱心并善于施教并行;对待工作认真负责，善于沟通、协调有较强的组织能力与团队精神;上进心强、勤于学习能不断进步自身的能力与综合素质。在未来的工作中，我将以充沛的精力，刻苦钻研的精神来努力工作，稳定地进步自己的工作能力，与公司同步发展。', '7000', '2', 1, '/profile/2020/11/04/aa1cf589-43d4-4a5c-aa40-8b598b7a6368.docx');
INSERT INTO `job_resume` (`id`, `most_education`, `education`, `address`, `experience`, `individual_resume`, `money`, `position_id`, `user_id`, `files`) VALUES (2, '博士', '大专', '北京', '2年以上', '热情随和，活波开朗，具有进取精神和团队精神，有较强的动手能力。良好协调沟通能力，适应力强，反应快、积极、灵活，爱创新!两年的会计经历锻炼了我细心的准则，以及冷静解决困难的能力。不过参加实践活动有限，社会经验相对缺乏，我相信通过立足于社会能不断提升发展自己。', '12000', '2', 2, '/profile/2020/11/03/95474274-4c4d-467c-94a1-9959521abee4.docx');
INSERT INTO `job_resume` (`id`, `most_education`, `education`, `address`, `experience`, `individual_resume`, `money`, `position_id`, `user_id`, `files`) VALUES (3, '博士', '大专', '北京', '2年以上', '本人具有较强的责任心和工作主动性，较好的组织协调能力和应变能力，可以和各个部门的同事相处融洽，配合顺利地完成工作任务，</span><span style=\"font-family:Microsoft YaHei;font-size:14px;\">为人诚实并得到领导的认可！曾去广州、上海等地参加国际性展会，有翻译和外贸经验及出国参展经验！本人性格开朗，善于沟通，谦虚，自信。', '14000', '3', 3, '/profile/2020/11/03/95474274-4c4d-467c-94a1-9959521abee4.docx');
INSERT INTO `job_resume` (`id`, `most_education`, `education`, `address`, `experience`, `individual_resume`, `money`, `position_id`, `user_id`, `files`) VALUES (4, NULL, NULL, '天龙人2222', NULL, NULL, NULL, NULL, 10, NULL);
