INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (137, '工作细胞：细胞大作战', '喜剧,动画', 'iMax 3d', '2021-04-09(中国大陆),2020-09-05(日本)', '700538', '4701', '111分钟(中国大陆)', '越看越过瘾', '2021年第12周 中国大陆票房排行 1', '　　这是人类的体内。\n                                    \n                                　　许许多多的细胞勤奋工作的世界。\n                                    \n                                　　某日白细胞(中性粒细胞)与红细胞，遇见了收留迷路乳酸菌的一般细胞。为了将乳酸菌护送至同伴身边，白细胞(中性粒细胞)与一般细胞向肠道出发。\n                                    \n                                　　然而他们却与来者不善的最强敌人重逢。\n                                    \n                                　　「我和你们到底谁才是正义的一方，趁这次弄个清楚吧」\n                                    \n                                　　再次现身的癌细胞。以及遭到坏菌破坏的肠内环境。\n                                    \n                                　　体内遭遇前所未有的大危机！？\n                                    \n                                　　「束手就擒吧 癌细胞！」\n                                    \n                                　　为了守护这个世界，白细胞们(中性粒细胞)向赌上世界命运的大战发起挑战。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '7.1', 'https://img2.doubanio.com/view/photo/s_ratio_poster/public/p2635186282.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (138, '日不落酒店', '喜剧', 'iMax 3d', '2021-03-19(中国大陆)', '2196167', '8872', '106分钟', '视觉情节双重享受', '2021年第12周 中国大陆票房排行 1', '　　故事发生在一家复古英式酒店，经理石月（黄才伦 饰），从工作到生活，过得像数学公式，无瑕疵且没毛病，年复一年如出一辙。无聊日子终于被一个意外假期所颠覆，妻子橘子（张慧雯 饰）怀孕、乌龙旅途、神秘房客……匪夷所思的离奇事件不断上演，无趣严谨的生活被打破，通关打怪般的解决危机 ，新生活会不会就在眼前……', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '2.8', 'https://img2.doubanio.com/view/photo/s_ratio_poster/public/p2634744472.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (139, '生生', '剧情', 'iMax 2d', '2021-04-02(中国大陆),2018-03-09(中国台湾),2017-11-04(高雄电影节)', '2399744', '1396', '99分钟(中国大陆)', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '　　“什么是死亡？”这个问题对于刚失去哥哥的小孩子生生（吴至璿 饰）来说可能太难回答了。他拿到了哥哥的手机，发现他一直在关注一个网络直播，名叫“活过一百天”。这个直播间的明星一位叫莉莉（鲍起静 饰）的老奶奶。老奶奶被诊断出肺癌晚期，但是在很努力地生活，且已经超出了医生的预期。这两人将一起去探索到底什么是死亡这个问题……', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '6.9', 'https://img9.doubanio.com/view/photo/s_ratio_poster/public/p2637042816.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (140, '红色娘子军', '战争', 'iMax 3d,中国巨幕', '2021-04-01(中国大陆)', '30984', '8899', '110分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '      1930年，海南岛椰林寨大地主南霸天的丫头琼花为挣脱毒手，多次反抗逃走，屡被抓回，关进了水牢。装扮成华侨巨商的红色娘子军党代表洪常青以买其做丫鬟为由，救出琼花，指引她参加娘子军，走上了革命道路。琼花在洪常青的帮助下，克服了报私仇的想法，在队伍中逐渐成长。后来，在分界岭狙击战中，洪常青为掩护娘子军，负伤被捕，遭敌人杀害。琼花在洪牺牲后继任娘子军党代表，对南霸天执行枪决，带领娘子军迈向革命斗争的新征程。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '7.3', 'https://img3.doubanio.com/view/photo/s_ratio_poster/public/p2044374611.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (141, '最佳导演', '剧情,喜剧', 'iMax 2d', '2021-04-09(中国大陆),2019-10-14(平遥国际影展)', '2428689', '369', '93分钟', '越看越过瘾', '2021年第12周 中国大陆票房排行 1', '　　故事始于一次游子还乡。久作他乡客的游子成为“最佳导演”章章（金靖承 饰）声名鹊起，携未婚妻珊妮（蒋楚依 饰）衣锦还乡。新人原本打算新式的旅行结婚遭逢家人反对。在故乡，一场由父母和三姑六婆共同操持“办给新人家长和亲友的真人秀”婚礼被迫推进。究竟是新人需要一个“有情人终成‘家属’”的仪式去纪念爱情，还 是家人需要一场婚礼来确证传承至今的古老婚俗是真理。新旧观念的摩擦无法避免，夹杂在古老与现代冲突之中的婚礼，满是荒诞感。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '7.0', 'https://img2.doubanio.com/view/photo/s_ratio_poster/public/p2637414853.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (142, '寻梦历险记', '动画,奇幻', 'iMax 2d', '2021-04-09(中国大陆),2019-03-08(瓜达拉哈拉电影节),2019-10-30(墨西哥)', '2313775', '160', '89分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '　　在墨西哥的圣克拉拉镇，住着一个十六岁的孤儿萨尔玛。她从未见过亲生父母，人们一直告诉她父母抛弃了她。萨尔玛一生中的大部分时间都在寻找关于父母的身份和下落的线索，但幸运女神似乎从未降临，直到她发现了一本特别的书，里面充满了发生在圣克拉拉的故事以及当地居民的历史。带着这本书，萨尔玛和她的两个勇敢而温暖的养兄弟豪尔赫和佩德罗踏上了一段冒险之旅，寻找自己与家族历史之间的联系，希望最终能见到失散多年的父母。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '5.1', 'https://img1.doubanio.com/view/photo/s_ratio_poster/public/p2558442607.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (143, '你好，李焕英', '剧情,喜剧,奇幻', 'iMax 2d', '2021-02-12(中国大陆)', '723192', '964143', '128分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '　　2001年的某一天，刚刚考上大学的贾晓玲（贾玲 饰）经历了人生中的一次大起大落。一心想要成为母亲骄傲的她却因母亲突遭严重意外，而悲痛万分。在贾晓玲情绪崩溃的状态下，竟意外的回到了1981年，并与年轻的母亲李焕英（张小斐 饰）相遇，二人形影不离，宛如闺蜜。与此同时，也结识了一群天真善良的好朋友。晓玲以为来到了这片“广阔天地”，她可以凭借自己超前的思维，让母亲“大有作为”，但结果却让晓玲感到意外......', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '8.1', 'https://img1.doubanio.com/view/photo/s_ratio_poster/public/p2629056068.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (144, '五尺天涯', '剧情,爱情', 'iMax 3d,中国巨幕', '2021-03-12(中国大陆),2019-03-15(美国)', '2398418', '45264', '116分钟', '视觉情节双重享受', '2021年第12周 中国大陆票房排行 1', '　　女孩斯黛拉（海莉·露·理查森 Haley Lu Richardson 饰）在医院结识了男孩威尔（科尔·斯普罗斯 Cole Sprouse 饰），但因为“囊性纤维化”疾病，他们之间的相处必须永远相隔“六英尺”，即使触不可及也不能阻挡两人逐渐升温的情愫。他们的爱情能够战胜疾病和死亡吗？', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '7.3', 'https://img1.doubanio.com/view/photo/s_ratio_poster/public/p2634893087.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (145, '平安中国之守护者', '犯罪', 'iMax 2d', '2021-03-19(中国大陆)', '2232350', '823', '90分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '　　该片由中央政法委组织拍摄，以真实人物为原型，以具体案例为线索，通过五个感人的故事，艺术展现了政法队伍建设和守护平安中国的使命担当。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '4.6', 'https://img9.doubanio.com/view/photo/s_ratio_poster/public/p2579445995.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (146, '铁道游击队', '战争', 'iMax 3d,中国巨幕', '1956(中国大陆)', '952104', '13081', '80分钟', '越看越过瘾', '2021年第12周 中国大陆票房排行 1', '　　抗日战争时期，鲁南临城、枣庄一带的铁路线上活跃着一支游戏队，队员在大队长刘洪（曹会渠）、政委李正（冯奇）的领导组织下，配合主力部队给予了日军沉重的打击，被当地百姓亲切地称为“飞虎队”。\n                                    \n                                　　日军想方设法偷袭“飞虎队”，终使刘洪受伤，但刘洪因此得以被寡妇芳林嫂（秦怡）照料，成 就一对爱人。刘洪伤愈后，配合李正指挥作战，大败日军。恼羞成怒的日军欲以肆意杀戮之法激怒刘洪，刘洪中计，准备在微山湖与日军展开正面交锋，幸得李正及时劝阻，“飞虎队”力量才得以保全。修整后的“飞虎队”将沿线日军悉数歼灭，但芳林嫂却在执行侦察任务时被捕。\n                        \n©豆瓣', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '7.6', 'https://img1.doubanio.com/view/photo/s_ratio_poster/public/p2251435268.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (147, '寻龙传说', '动画,奇幻,冒险', 'iMax 2d', '2021-03-05(中国大陆/美国)', '1775618', '73663', '108分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '　　很久以前，在充满奇幻色彩的龙佑之邦，人类和龙和谐地生活在一起。但当一股邪恶的力量袭来，龙牺牲了自己来拯救人类。500年后，同样的邪恶力量卷土重来，只有一个孤独的战士拉雅（凯莉·玛丽·陈 配音）承担重任，追踪传说中的最后一条龙，以修复这块破碎的土地，团结分裂的人民。在她的旅程中，她也会逐渐了解到拯救世界不仅仅需要一条龙，还需要信任和团队合作。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '7.2', 'https://img9.doubanio.com/view/photo/s_ratio_poster/public/p2633531206.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (148, '指挥家', '剧情,爱情,传记', 'iMax 3d', '2021-01-22(中国大陆),2018-10-25(荷兰)', '1846634', '5916', '140分钟(中国大陆)', '越看越过瘾', '2021年第12周 中国大陆票房排行 1', '　　影片是一部真实的女性职场奋斗史，看出身底层的女性如何突破职场“天花板”，成为史上第一位女性指挥家！当爱情和梦想“狭路相逢”，看她如何“指挥”人生，成就自我！电影根据真人故事改编，讲述“史上最伟大女指挥家”安东尼娅‧布⾥克勇敢追求音乐梦想，在女性社会地位极度受限的上世纪20年代，最终实现自我价值的故事。她出身微寒，却心怀音乐梦想。追梦途中，在以男性为主导的音乐世界中历尽荆棘和冷眼，却永不言弃。当希望的曙光初露，她深爱的男人却希望她为爱止步，最终她毅然选择飞往追寻音乐梦想的欧洲，可他们的爱情又将何去何从......电影由荷兰名导玛利亚·彼得斯执导。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '7.4', 'https://img3.doubanio.com/view/photo/s_ratio_poster/public/p2630029701.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (149, '明天会好的', '爱情,喜剧', 'iMax 3d,中国巨幕', '2021-04-02(中国大陆)', '361330', '5651', '101分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '      我27岁了，我也不会开车，也没有出过国，用的还是9块9的唇膏，我这辈子到现在为止，都是靠自己。一个女孩要过多少坎儿，才可以有真正的快乐生活？可能要遇见渣男，糟心的工作，要接受好闺蜜不再属于自己，爸妈的极速老去。萧渝（papi酱 饰）在大城市打拼许久，她的新室友是音乐人季野（张超 饰），两个在生活中都不如意的人，彼此陪伴，那么明天，真的会好吗？', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '5.4', 'https://img9.doubanio.com/view/photo/s_ratio_poster/public/p2638146404.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (150, '圣山村谜局', '剧情', 'iMax 2d', '2021-04-01(中国大陆)', '2855561', '426', '81分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '　　电影是一部“藏族题材”悬疑影片，讲述了圣山村突发的一起命案，让原本平静的山村被惊悚笼罩，无论是悬崖下狂奔的尸体，恐慌的村民，坠亡的村霸，还是消失的村长，神色慌张的情侣…都让恐怖不断发酵，惊悚持续升级。影片逻辑缜密，全程烧脑，悬念十足！迷局真相让人心生惊骇！', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '0', 'https://img3.doubanio.com/view/photo/s_ratio_poster/public/p2637002460.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (151, '上甘岭', '剧情,战争', 'iMax 2d', '2021-04-01(中国大陆)', '332103', '12464', '124分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '       1952年秋，美国侵略者在板门店宣布无限期休会后，便在朝鲜中部三八线附近发动了一次大规模攻势，企图攻占上甘岭，进而夺取五圣山。八连连长张忠发奉命执行主峰阵地的坚守任务，打退了敌人二十多次的疯狂进攻。在坑道里，他们克服了各种难以想象的困难。坑道内严重缺水，战士们互相鼓励，顽强坚守24天，使后方做好了大进攻的准备，一举歼灭敌人。上甘岭战役在根本上改变了朝鲜战争的形势，美国侵略者最终不得不在停战协定上签字。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '8.1', 'https://img9.doubanio.com/view/photo/s_ratio_poster/public/p2537259656.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (152, '又见奈良', '剧情', 'iMax 2d', '2021-03-19(中国大陆),2020-07-31(上海电影节)', '1699759', '20056', '100分钟', '视觉情节双重享受', '2021年第12周 中国大陆票房排行 1', '　　电影讲述了一段跨越60年的异国无血缘母女情。年近八十的老奶奶陈慧明（吴彦姝 饰）孤身奔赴奈良，寻找失去联系的养女陈丽华。在遗孤二代小泽（英泽 饰）和退休警察一雄（國村隼 饰）的帮助下，找到了许多接触过、帮助过丽华的人们。在这个过程中，陈慧明如同亲历丽华到达日本之后的人生，她与小泽、一雄之间的关系，也在这段旅程中更加贴近了。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '7.5', 'https://img3.doubanio.com/view/photo/s_ratio_poster/public/p2634228191.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (153, '小美人鱼的奇幻冒险', '动画 奇幻 家庭', 'iMax 3d,中国巨幕', '2021-04-17(中国大陆)', '2444392', '198', '82分钟', '越看越过瘾', '2021年第12周 中国大陆票房排行 1', '      海的女儿—美人鱼作为经典的童话故事之一伴随几代人的童年记忆在世间广为流传。本片讲述在神秘的海洋国度，美丽勇敢的小美人鱼抗争传统束缚，追求自由从而改变自己命运的故事。此片再现“美人鱼”的纯真世界，用积极且充满正能量的内容再一次唤起大众对于这个经典题材的兴趣。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '0', 'https://img9.doubanio.com/view/photo/s_ratio_poster/public/p2638815894.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (154, '唐人街探案3', '喜剧,悬疑', 'iMax 3d', '2021-02-12(中国大陆)', '2686756', '783894', '136分钟', '越看越过瘾', '2021年第12周 中国大陆票房排行 1', '　　继曼谷、纽约之后，东京再出大案。唐人街神探唐仁（王宝强 饰）、秦风（刘昊然 饰）受侦探野田昊（妻夫木聪 饰）的邀请前往破案。“CRIMASTER世界侦探排行榜”中的侦探们闻讯后也齐聚东京，加入挑战，而排名第一Q的现身，让这个大案更加扑朔迷离，一场亚洲最强神探之间的较量即将爆笑展开……', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '5.6', 'https://img2.doubanio.com/view/photo/s_ratio_poster/public/p2622388983.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (155, '我的姐姐', '剧情,家庭', 'iMax 2d', '2021-04-02(中国大陆)', '3124751', '155851', '127分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '　　影片围绕失去父母的姐姐在面对追求个人独立生活还是抚养弟弟的问题上展开了一段细腻感人的亲情故事。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '7.1', 'https://img3.doubanio.com/view/photo/s_ratio_poster/public/p2630463690.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (156, '21座桥', '动作,悬疑,犯罪', 'iMax 2d', '2021-03-19(中国大陆),2019-09-25(印度尼西亚),2019-11-22(美国)', '2511629', '22252', '99分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '　　事业失意的纽约警探安德烈·戴维斯（查德维克·博斯曼 饰）意外被任命追捕一起重大涉毒杀人案的凶手。在这个骇人听闻的案件中，八名警察惨遭谋杀。为了让凶手尽快落网，戴维斯开启了曼哈顿历史上第一次全境封锁，岛上与外界联系的21座桥全部禁止出入。但封锁时间只有四个小时，戴维斯必须在天亮之前抓到凶手！在紧张的追捕行动中，戴维斯发现凶手也同样在被追杀，这起案件背后可能藏着一个滔天阴谋，他必须在一切不可挽回之前找出凶手并查明真相。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '6.6', 'https://img3.doubanio.com/view/photo/s_ratio_poster/public/p2635094940.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (157, '第十一回', '剧情 喜剧 家庭', 'iMax 3d', '2021-04-02(中国大陆)', '1487516', '84459', '117分钟', '视觉情节双重享受', '2021年第12周 中国大陆票房排行 1', '      30年前一桩杀人案，被市话剧团拿来改编成舞台剧，马福礼（陈建斌 饰）作为杀人案的当事人，旧事重提让他的生活再起波澜。马福礼一边忙着和话剧团导演胡昆汀（大鹏 饰）纠缠掰理，一边找律师翻案寻求真相还自己清白，还要忙着调和妻子金财铃（周迅 饰）和女儿金多多（窦靖童 饰）剑拔弩张的关系，生活给了他多记重锤……时隔多年，马福礼能否重新翻案？真相到底有几个？人生如戏，请君入席。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '7.5', 'https://img9.doubanio.com/view/photo/s_ratio_poster/public/p2637603645.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (158, '西游记之再世妖王', '动作,动画,奇幻', 'iMax 2d', '2021-04-02(中国大陆)', '711699', '7514', '95分钟', '视觉情节双重享受', '2021年第12周 中国大陆票房排行 1', '　　混沌初开之时，世上的第一只妖降世，名元蒂（张磊 配音），被奉为妖祖。千百万年后，昔日妖王孙悟空（边江 配音）被唐僧（苏尚卿 饰）从五行山下救出，悟空答应保护唐僧，前往西天取经。而传说中的妖祖元蒂再次现世，三界岌岌可危。两代妖王注定终极一战，但这次，孙悟空遇上了真正的劲敌。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '5.6', 'https://img3.doubanio.com/view/photo/s_ratio_poster/public/p2637771301.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (159, '波斯语课', '剧情', 'iMax 2d', '2021-03-19(中国大陆),2020-02-22(柏林电影节),2020-09-24(德国)', '383957', '151254', '127分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '　　二战期间，犹太人小卷在集中营谎称自己是波斯人保命，被一位德国军官看中要求教自己波斯语。对波斯语完全不懂的小卷只能凭空编出一门语言，他开始用集中营中关押的犹太人的名字作为词根，编造出上千个“波斯语”单词，军官在残暴的环境中对小卷竟有了依赖，并开始袒护他，不料集中营中来了一个真正的波斯人……', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '8.2', 'https://img9.doubanio.com/view/photo/s_ratio_poster/public/p2637021404.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (160, '刺杀小说家', '动作,奇幻,冒险', 'iMax 3d', '2021-02-12(中国大陆)', '2157151', '439859', '130分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '　　异世界皇都，天神赤发鬼残暴统治，滥杀无辜。少年空文因被赤发鬼追杀，决定奋起反击。在黑甲（郭京飞 饰）的指引下，踏上了凡人弑神之路。这是小说家路空文（董子健 饰）笔下的奇幻世界。没想到小说的进程，竟然影响着现实世界。这时一名男子（雷佳音 饰）接下了刺杀他的任务……', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '6.9', 'https://img9.doubanio.com/view/photo/s_ratio_poster/public/p2628440875.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (161, '猫和老鼠', '喜剧,动画,冒险', 'iMax 3d,中国巨幕', '2021-02-26(美国/中国大陆),2021-02-10(中国台湾)', '2104617', '32692', '101分钟', '视觉情节双重享受', '2021年第12周 中国大陆票房排行 1', '　　“超杀女”科洛·莫瑞兹饰演的少女凯拉刚刚入职豪华大酒店，就碰上了叫人头疼的难题——杰瑞竟然想在酒店里定居，令酒店最近承接的世纪婚礼岌岌可危。于是，汤姆被凯拉雇佣成为酒店员工，目的是赶走杰瑞，这对欢喜冤家就此展开了一场你追我赶的爆笑喜剧。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '5.4', 'https://img3.doubanio.com/view/photo/s_ratio_poster/public/p2632043260.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (162, '温泉屋的小老板娘', '动画,家庭', 'iMax 3d', '2021-01-29(中国大陆),2018-06-11(安锡动画电影节),2018-09-21(日本)', '2415725', '9012', '95分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '　　小学六年级的小织，在父母车祸双亡后被经营温泉旅馆「春之屋」的外婆收养，也开始了她的小女将修行之路。少根筋又冒失的她，时常被敌对旅馆同龄之女秋野真月嘲笑。但生性乐天的小织，在旅馆里的幽灵小卖、美阳及铃鬼鼓励之下，努力地招待每位客人。是一部温暖且欢乐的女孩成长记。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '7.2', 'https://img9.doubanio.com/view/photo/s_ratio_poster/public/p2631409396.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (163, '迷雾追凶', '悬疑,惊悚,犯罪', 'iMax 2d', '2021-04-09(中国大陆),2017-10-26(意大利)', '2942096', '2559', '129分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '　　阿尔卑斯山脚下的小镇上，大雾引发了一场交通事故，失事司机就是前来调查少女失踪案的警探沃格尔（托尼·塞尔维洛 饰），中学老师马提尼（阿莱西奥·博尼 饰）是他锁定的嫌犯。在心理医生弗洛里斯（让·雷诺 饰演）的疏导下，沃格尔缓缓道出幕后真相，一场酝酿已久的更大阴谋也逐渐显露真容。\n                                    \n                                　　改编自畅销全球的惊悚小说《雾中的女孩》。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '6.8', 'https://img1.doubanio.com/view/photo/s_ratio_poster/public/p2639020237.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (164, '超级的我', '奇幻 冒险', 'iMax 3d', '2021-04-09(中国大陆)', '580838', '3637', '103分钟', '越看越过瘾', '2021年第12周 中国大陆票房排行 1', '      如果睡觉能赚钱，如果做梦能致富，但是要付出代价，你加入吗？18线小编剧桑榆（王大陆 饰）原本生活困顿拮据，但一夜之间却拥有了梦中取物的神奇能力，通过将梦中的宝物变现，潦倒落魄的他成为人生赢家，甚至一掷千金追求到暗恋多年的花儿（宋佳 饰），然而在梦中快意掠取的桑榆却逐渐发现，这场躺赢美梦竟将他的生活推向了失控的边缘……', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '5.2', 'https://img1.doubanio.com/view/photo/s_ratio_poster/public/p2639382329.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (165, '哥斯拉大战金刚', '动作,科幻,冒险', 'iMax 3d', '2021-03-26(中国大陆),2021-03-24(中国台湾),2021-03-31(美国)', '622571', '189727', '113分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '　　这两位宛如神衹一般强大的对手于一场壮观的战争中相遇，彼时世界命运正悬于一线。为了找到真正的家园，金刚与他的保护者们踏上了一次艰难的旅程。与他们一道前行的还有一个年轻的孤儿女孩——吉雅，这个女孩与金刚之间存在着一种独特而强大的紧密联系。但意想不到的是，他们在前行的航道上与愤怒的哥斯拉狭路相逢，也由此在全球引起了一系列破坏。一股无形的力量造成了这两只巨兽之间的巨大冲突，深藏在地心深处的奥秘也由此揭开。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '6.5', 'https://img9.doubanio.com/view/photo/s_ratio_poster/public/p2634253484.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (166, '地雷战', '剧情 战争', 'iMax 3d,中国巨幕', '2021-04-01(中国大陆)', '1154632', '34511', '74分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '      抗日战争时期，胶东抗日根据地赵家庄和附近几个村庄，经常遭受日寇的袭击和扫荡。为打击日寇，区武委会雷主任领导赵家庄等村庄组成民兵联防。赵家庄民兵队长赵虎发动群众，制造了各种土地雷，布下雷阵，使日寇受到沉重打击。为了破坏地雷阵，日军中队长中野搬来工兵清雷，攻入赵家庄烧杀抢掠。赵虎总结教训，改进地雷，制造了土化学雷，粉碎敌人阴谋。麦收时节，日军偷袭赵家庄，掳走一些村民，并胁迫村民走在队伍前“趟地雷”。赵虎将计就计，巧设雷阵，在八路军支援下解救了群众，粉碎了敌人的扫荡。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '8.0', 'https://img2.doubanio.com/view/photo/s_ratio_poster/public/p2537715313.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (167, '错爱迷踪', '悬疑,惊悚', 'iMax 2d', '2021-03-05(中国大陆)', '2710720', '249', '86分钟', '视觉情节双重享受', '2021年第12周 中国大陆票房排行 1', '　　午夜，灵异恐怖的小尸妹阴魂归来！屡次被惨死的女鬼魂魄缠身，床底飘忽而现的惊悚长发，衣柜里离奇出现又瞬间消失的半截白衣服，镜头中忽隐忽现的白色诡影，阴森凄厉的呼叫声此起彼伏，惊吓渗入骨髓的鬼压床夜幕准时降临，落入恐怖深渊的女孩半夜再次被鬼魂附体持刀行凶，每时每刻都能遇见怪象……一段冤魂索命，血腥残酷的复仇夺命之旅悄然开启！错爱一人，如若进入死亡迷宫，厄运附体难逃鬼魅附身，一生怪异凄惨！不被理解的痛苦、难以诉说的恐惧感时刻刺痛着她极度崩溃的神经。然而这一切只是开始，不是最终！借尸还魂的惊天阴谋正以极端狠戾残暴的的方式步步紧逼，人与鬼的契约逐渐显现，尖叫式惊悚一触即发……', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '0', 'https://img2.doubanio.com/view/photo/s_ratio_poster/public/p2631660672.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (168, '人潮汹涌', '喜剧,犯罪', 'iMax 2d', '2021-02-12(中国大陆)', '705887', '204330', '119分钟', '越看越过瘾', '2021年第12周 中国大陆票房排行 1', '　　陈小萌（肖央 饰）一直渴望成为一名演员，但残酷的现实令他至今扔在龙套的位置上苦苦挣扎。没钱没工作没恋人没朋友还欠了一大笔钱的陈小萌想到了死，可是就连死神都抛弃了他，他数次自杀都以失败告终。\n                                    \n                                　　一天，陈小萌去澡堂泡澡，意外邂逅了一位神秘且富有的男子（刘德华 饰），该男子在澡堂里意外摔倒昏迷被送进了医院，拾得了他的储物室手环的陈小萌决定顶替他的身份，享受一下富人的生活。头部的撞击令男子失忆了，凭借着零星的线索，他认定自己是陈小萌，并且顺藤摸瓜来到了陈小萌的出租屋，希望熟悉的环境能够令他更快的恢复记忆。在此过程中，男子邂逅了名为李香（万茜 饰）的自媒体人，两人之间碰撞出了火花。\n                        \n©豆瓣', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '7.1', 'https://img9.doubanio.com/view/photo/s_ratio_poster/public/p2632862664.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (169, '非正式爱情', '喜剧,爱情', 'iMax 2d', '2021-03-26(中国大陆)', '170922', '448', '96分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '　　柔情硬汉石头和强势萝莉艾嘉在机缘巧合下卷入是非，由此产生误会。艾嘉为达到目的套路石头从猫捉老鼠到女仆游戏，轮番上演爱情三十六计。相爱相杀的两人开启一段5g升级爱情故事。然而种种意外导致背后秘密浮出水面，非正式爱情该如何继续......', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '0', 'https://img9.doubanio.com/view/photo/s_ratio_poster/public/p2629435956.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (170, '星际侠探', '科幻,动画,冒险', 'iMax 2d', '2021-03-20(中国大陆)', '882913', '40', '90分钟', '视觉情节双重享受', '2021年第12周 中国大陆票房排行 1', '　　《星际侠探》讲述了一个星际侦探保卫地球的故事。有些自大的星际侦探小贝在追捕宇宙强盗黑洞的激战过程中，意外坠入地球。在地球上，小贝遇到了人类女孩小依和星际赏金猎人极光。同时，以黑洞为首的星际逃犯组织，正准备开启星际隧道摧毁地球。在小依和极光同心协力的帮助下，小贝也逐渐克服自己的缺点，成长为一名真正的星际侠探。正当黑洞即将开启毁灭地球的星际隧道时，小贝和小伙伴们和黑洞展开了一场保卫地球的生死之战……', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '0', 'https://img2.doubanio.com/view/photo/s_ratio_poster/public/p2634978773.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (171, '小兵张嘎', '剧情,儿童,战争', 'iMax 3d,中国巨幕', '2021-04-01(中国大陆)', '3111199', '33800', '101分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '       抗战时期的河北白洋淀，少年张嘎目睹奶奶被日寇杀害、侦察连长钟亮被抓走。他去找八路军报信，却误把侦察排长罗金保当作汉奸。调皮捣蛋的嘎子因为一把木抢，和小伙伴胖墩打赌耍赖、堵人家烟囱，被关禁闭。在区队长和罗金保的关怀教育下，他逐渐端正了革命态度。在随后的一场伏击战中，嘎子受伤，痊愈后去追赶部队，途中被捕。区队长、罗金保带领战士们伪装送粮队伍攻进鬼子据点，救出钟亮。嘎子放火点着了炮楼，与八路军里应外合，立下大功。嘎子交出自己先前私藏的手枪，区队长又给枪还给了他。通过战斗的洗礼，嘎子成长为一名真正的八路军战士。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '7.8', 'https://img3.doubanio.com/view/photo/s_ratio_poster/public/p2314095621.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (172, '歌声的翅膀', '剧情,歌舞', 'iMax 2d', '2021-03-28(中国大陆),2019-10-28(人民大会堂)', '1284516', '140', '114分钟', '越看越过瘾', '2021年第12周 中国大陆票房排行 1', '　　影片讲述了三个不同民族的年轻音乐人，不甘艺术“高原”，踏上了追寻音乐“高峰”的采风之旅。在他们走遍新疆大地的过程中，采撷到了各民族丰富的音乐舞蹈营养，并最终在慕士塔格冰峰前，创作并唱响了新歌《大地之歌》，实现了音乐梦想。', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '0', 'https://img3.doubanio.com/view/photo/s_ratio_poster/public/p2573030760.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (173, '奇异世界历险记', '喜剧,动画,冒险', 'iMax 3d,中国巨幕', '2021-04-03(中国大陆)', '1369403', '59', '143分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '      超级学霸宇文数学一直认为人生的成功应该用奖状和金牌堆砌而成，从不屑于与同龄人玩耍的他为了完成团队作业不得不进入儿童乐园，误打误撞中进入了奇异世界，在这里，他和他的同伴们会发生怎样的奇幻冒险呢？', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '0', 'https://img3.doubanio.com/view/photo/s_ratio_poster/public/p2632089700.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (174, '熊出没·狂野大陆', '喜剧,科幻,动画', 'iMax 2d', '2021-02-12(中国大陆),2020-08-01(上海电影节)', '825553', '18177', '99分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '　　狗熊岭附近新开业了一个神奇的“狂野大陆”，在那里，通过基因技术人可以自由变身各种动物，享受无比的自由和快乐。导游事业受挫的光头强，阴差阳错与神秘人乐天和熊二组队，参加乐园里奖金丰厚的比赛，却遭遇了队友乐天的背叛，历尽艰险终于获得冠军之际，却意外发现狂野大陆里隐藏着惊天的阴谋......', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '6.6', 'https://img3.doubanio.com/view/photo/s_ratio_poster/public/p2631708261.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (175, '南昌起义', '战争', 'iMax 2d', '1981', '2964688', '882', '108分钟', '2021必看的电影之一', '2021年第12周 中国大陆票房排行 1', '　　1926年夏，奉系军阀在国民革命军二次北伐中惨败。周恩来（孔祥玉 饰）受党指派去找贺龙（高长利 饰），询问其下一步打算，面对连年军阀混战，贺龙早已厌倦，他表示愿意跟党走。周恩来在中央全会上分析了当时严峻局势，得知汪精卫（李宁 饰）已准备向工人纠察队动手，他果断解散纠察队，将人员武器编入贺龙二十军。得知汪要发动反革命政变，经请示中央，周恩来提出举行武装暴动，恽代英（叶新民 饰）等全力支持，此议获中央批准，并委任周为敌前委书记总负责。抵南昌后，叶剑英（王瑞 饰）及时识破汪精卫图谋斩首诡计，通知贺龙、叶挺（王定华 饰）率部做好起义准备。朱德（刘怀正 饰）向周恩来等作了武装暴动详情介绍，刁铁民（王华英 饰）阵前做说客遭贺龙逮捕，张国焘（王际春 饰）阻止未果，周恩来下达了起义命令......\n                        \n©豆瓣', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '6.5', 'https://img1.doubanio.com/view/photo/s_ratio_poster/public/p2553125807.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
INSERT INTO `movie_list` (`movie_id`, `movie_name`, `movie_type`, `cinema_type`, `movie_show_time`, `want_num`, `saw_num`, `movie_time`, `movie_desc`, `movie_honner`, `movie_introduce`, `publish`, `technology_parmas`, `guidance`, `total_box_office`, `week_box_office`, `yeast_box_office`, `is_sale`, `score`, `movie_img`, `revision`, `created_by`, `created_time`, `updated_by`, `updated_time`) VALUES (176, '新神榜：哪吒重生', '动作,动画,奇幻', 'iMax 3d', '2021-02-12(中国大陆)', '1498313', '104821', '116分钟', '越看越过瘾', '2021年第12周 中国大陆票房排行 1', '　　三千年前，天下动荡，人神共遇大劫，不想哪吒的一缕魂魄逃脱天罗地网，世世转世投胎，这一世与东海市酷爱机车的热血青年李云祥人神共生。然而龙族对哪吒恩怨并未善罢甘休，有着哪吒元神的李云祥，亦无法逃脱被龙族赶尽杀绝的宿命。东海危在旦夕，李云祥是否能够与哪吒元神并肩作战，成为抵抗龙族的英雄？东海市的子民能否得到拯救？', '北京国家中心传媒有限公司', '彩色', '青少年12-18岁由家长陪同观看', '54210', '32154', '2', '1', '7.2', 'https://img9.doubanio.com/view/photo/s_ratio_poster/public/p2631711326.jpg', 0, '', '2021-04-25 07:46:56', '', NULL);
