INSERT INTO `political_activity` (`id`, `content`, `theme`, `img_url`, `starter`, `satr_time`, `ends_time`, `upper_limit`, `address`, `people`) VALUES (1, '今天天气好，一起出去春游！', '春游', '/profile//2020/10/14/e5b292f5-fe0e-4bf2-92d7-34bee1d1ccbe.jpg', '用户1', '2020-10-14 16:59:11', '2020-10-14 16:59:11', '200', '大连', '20');
INSERT INTO `political_activity` (`id`, `content`, `theme`, `img_url`, `starter`, `satr_time`, `ends_time`, `upper_limit`, `address`, `people`) VALUES (2, '作为云南省内最热门旅游城市，假期间昆明市共接待游客886.68万人次，基本恢复至去年同期水平，省内外的游客，旅游线路都以昆明市为中心，再向大理、丽江、蒙自、西双版纳等地延伸。', '旅游', '/profile//2020/10/14/e5b292f5-fe0e-4bf2-92d7-34bee1d1ccbe.jpg', '用户2', '2020-10-14 16:59:09', '2020-10-14 16:59:09', '120', '大连', '23');
INSERT INTO `political_activity` (`id`, `content`, `theme`, `img_url`, `starter`, `satr_time`, `ends_time`, `upper_limit`, `address`, `people`) VALUES (3, '对于熟悉省内环境的昆明本地游客而言，近距离的城市周边游是最方便也最普遍的选择，自由随性、一家一车的自驾游，成了今年昆明最热门的旅游方式。高端庭院烧烤：独立小庭院烧烤，有露营平台，隐居梨园，独立安静。', '自驾游', '/profile//2020/10/14/e5b292f5-fe0e-4bf2-92d7-34bee1d1ccbe.jpg', '用户2', '2020-10-14 16:59:08', '2020-10-14 16:59:08', '120', '大连', '10');
INSERT INTO `political_activity` (`id`, `content`, `theme`, `img_url`, `starter`, `satr_time`, `ends_time`, `upper_limit`, `address`, `people`) VALUES (4, '烧烤需要烟火气，自从火诞生以来，生的和熟的食物就可以区分开来，在人类漫长的进化史中，火起着非常重要的作用，烧烤自然成为人类最早的饮食方式', '烧烤', '/profile//2020/10/14/e5b292f5-fe0e-4bf2-92d7-34bee1d1ccbe.jpg', '用户2', '2020-10-14 16:59:08', '2020-10-14 16:59:08', '120', '大连', '21');
INSERT INTO `political_activity` (`id`, `content`, `theme`, `img_url`, `starter`, `satr_time`, `ends_time`, `upper_limit`, `address`, `people`) VALUES (5, '活动共设置可乐斜立、人体猜字、踩布翻转、团队九宫格、和秋天约会、舞彩飞扬等挑战项目，全体人员分成12支队伍，分别起队名、画队旗，进行形象展示。在挑战过程中，各支队伍团结协作，发挥所长，努力完成任务。经过激烈角逐，最后决出前三名，分别发放了小礼品奖励。', '团体活动', '/profile//2020/10/14/e5b292f5-fe0e-4bf2-92d7-34bee1d1ccbe.jpg', '用户2', '2020-10-14 16:59:07', '2020-10-14 16:59:07', '120', '大连', '15');
INSERT INTO `political_activity` (`id`, `content`, `theme`, `img_url`, `starter`, `satr_time`, `ends_time`, `upper_limit`, `address`, `people`) VALUES (6, '野炊让您体验人间烟火味，粗茶淡饭才是生活的真谛，自己动手捡柴生火、抓鸡捉鱼为同伴共同完成一顿丰富且美味的农家饭，什么最珍贵？无非就是健康的生命，快乐不是人前风光，是身体倍儿棒吃嘛嘛香！', '野炊', '/profile//2020/10/14/e5b292f5-fe0e-4bf2-92d7-34bee1d1ccbe.jpg', '用户1', '2020-10-14 16:59:13', '2020-10-14 16:59:13', '30', '大连', '22');
