INSERT INTO `political_feedback` (`id`, `theme`, `user_id`, `content`, `img_url`, `c_time`) VALUES (1, '生活垃圾处理能力', 1, '全省生活垃圾处理能力缺口超过1.5万吨/日，80个生活垃圾填埋场中，超负荷运行的48个，37个生活垃圾焚烧厂中，超负荷运行的10个，垃圾渗滤液处理能力不足，目前全省垃圾渗滤液暂存量约255万吨，环境安全隐患突出。', '16', NULL);
INSERT INTO `political_feedback` (`id`, `theme`, `user_id`, `content`, `img_url`, `c_time`) VALUES (2, '生活噪音', 1, '工地施工给需要午休的人们带来不少的困扰，希望能让工地避开休息时间施工', NULL, NULL);
INSERT INTO `political_feedback` (`id`, `theme`, `user_id`, `content`, `img_url`, `c_time`) VALUES (3, '城市道路拥堵', 2, '早晨上班高峰期，小摊小贩占用马路两旁导致交通拥堵', '17', NULL);
INSERT INTO `political_feedback` (`id`, `theme`, `user_id`, `content`, `img_url`, `c_time`) VALUES (4, '经济资讯', 1, '本周内市场重要的财经、时政、经济政策等信息', NULL, NULL);
INSERT INTO `political_feedback` (`id`, `theme`, `user_id`, `content`, `img_url`, `c_time`) VALUES (5, '关联行业信息', 1, '本周内肉类行业、餐饮行业、冷冻行业、物流行业、KA便超、零售等行业的重要动态及信息', NULL, NULL);
INSERT INTO `political_feedback` (`id`, `theme`, `user_id`, `content`, `img_url`, `c_time`) VALUES (6, '竞品动态的敏感度', 1, '本周内双汇、雨润、金锣、中粮、超汇、海欣、海壹、海霸王、升隆、惠发等厂家的经营动态和新品投放信息及各种促销活动和政策等市场行为', NULL, NULL);
