INSERT INTO `political_message` (`id`, `title`, `category_id`, `img_url`, `describes`, `content`, `number_people`) VALUES (1, '城市大脑', 1, 'updata/14.jpg', '0月12日至14日，第三届数字中国建设峰会在福建省福州市举办。峰会期间，主办方同步举办中国建设成果展览会。作为本届峰会广东省唯一一个地级市参展代表，佛山市精心打造了240平方米的“数字佛山”展区', '南海区作为以数字化推进城乡融合发展的探路者，也在展会上把“数字南海”的建设成果系统呈现。在佛山展区中，南海设置了南海“城市大脑”、南海区大数据产业协会、佛山市国信数字仿真技术研究院、政务服务自助服务区等4个展位，系统介绍了南海“数字政府”和智慧城市建设的经验与实践', 120);
INSERT INTO `political_message` (`id`, `title`, `category_id`, `img_url`, `describes`, `content`, `number_people`) VALUES (2, '让出行更文明 让城市更美好', 1, 'updata/15.jpg', '日前，呼和浩特市被正式命名“国家公交都市建设示范城市”，跻身26个示范城市之列，这也让公交文明话题再次受到关注', '公交车是城市主要交通工具，是城市的流动名片，车内环境文明与否，关系到乘客的心情，也直接反映出城市的文明程度。评价一座城市是否文明，可以看乘客坐公交车是否有序排队、相互礼让、相互帮助等。', 22);
INSERT INTO `political_message` (`id`, `title`, `category_id`, `img_url`, `describes`, `content`, `number_people`) VALUES (3, '中国改名最成功的城市', 1, 'updata/16.jpg', '说起中国现在有名的旅游景点，那真是数不胜数。', '每年游玩的游客数量也十分多，这给当地带来了很大的经济利益，也推动了城市发展。所以一个景点，除了要有真正的内容以外，最主要的还是一个容易记得的名字。', 23);
INSERT INTO `political_message` (`id`, `title`, `category_id`, `img_url`, `describes`, `content`, `number_people`) VALUES (4, '深圳二手房“金”', 1, 'updata/17.jpg', '成色不足 热点区域持续降温', '根据深房中协统计的二手房网签数据分析，9月份深圳二手房网签量（含自助网签）共计7489套，环比8月网签量（含自助网签）小幅反弹4.3%，相比“715“调控新政后市场反应最为剧烈的8月份而言，9月二手房网签量相对已企稳，甚至还出现小幅反弹，说明市场经过两个多月的消化，对新政的影响已逐步适应。', 33);
INSERT INTO `political_message` (`id`, `title`, `category_id`, `img_url`, `describes`, `content`, `number_people`) VALUES (5, '今日热点新闻', 1, '/profile//2020/10/14/e209339d-7e17-414e-ae66-b6f99df4faeb.jpg', '养老金已实现“16连涨”', '企业退休人员养老金已实现“16连涨”，城乡居民基础养老金最低标准调整也跟着来了！国庆前后，多地社保部门转发了人社部、财政部《关于2020年提高城乡居民基本养老保险全国基础养老金最低标准的通知》。这一待遇上调从7月份计起，多地承诺在10月底前补发、调整到位。', 45);
INSERT INTO `political_message` (`id`, `title`, `category_id`, `img_url`, `describes`, `content`, `number_people`) VALUES (7, '习近平向特朗普致慰问电', NULL, 'updata/14.jpg\r\nupdata/15.jpg\r\nupdata/16.jpg\r\nupdata/17.jpg\r\n/profile//2020/10/14/e209339d-7e17-414e-ae66-b6f99df4faeb.jpg', '国家主席习近平10月3日致电美国总统特朗普，就特朗普总统夫妇感染新冠病毒致以慰问。习近平在慰问电中表示，得知总统先生和梅拉尼娅女士感染新冠病毒，我和我夫人彭丽媛谨向你和你夫人表示慰问，祝你们早日康复。', '近年来，伴随特色小镇、美丽乡村建设扎实推进，依托乡村闲置民居进行改造再利用的民宿业快速发展，民宿设计成为国内建筑领域的热点话题之一。一些乡村民宿经过设计改造，既保留了民居的古朴之美，亦适应了现代生活方式，在一定程度上带动了乡村整体发展。', 67);
INSERT INTO `political_message` (`id`, `title`, `category_id`, `img_url`, `describes`, `content`, `number_people`) VALUES (8, '肖亚庆任工信部党组书记', NULL, 'updata/14.jpg', '日前，中共中央决定：肖亚庆同志任工业和信息化部党组书记，苗圩同志不再担任工业和信息化部党组书记。', '当前，短视频平台深入人们的日常生活，但部分网红为吸引用户点赞、转发、赚流量频出“奇招”，有的甚至突破法律红线。业内人士指出，优质内容才是网络平台健康发展的王牌，企图以突破底线来吸引眼球、换取流量的做法，于德不符、于法不容，这样的博主“走不好也走不远”。', 23);
INSERT INTO `political_message` (`id`, `title`, `category_id`, `img_url`, `describes`, `content`, `number_people`) VALUES (9, '十九届五中全会定于今年10月召开', NULL, 'updata/15.jpg', '中共中央政治局7月30日召开会议，决定今年10月在北京召开中国共产党第十九届中央委员会第五次全体会议，主要议程是，中共中央政治局向中央委员会报告工作，研究关于制定国民经济和社会发展第十四个五年规划和二〇三五年远景目标的建议。会议分析研究当前经济形势，部署下半年经济工作。中共中央总书记习近平主持会议', '距离中秋节还有不到10天，月饼也进入销售高潮。借着文创风的盛行，造型新颖、包装精美的文创月饼今年依然走俏。但记者发现，即便在倡导节俭的新风尚下，“小饼装大盒”的情形依然存在。', 11);
INSERT INTO `political_message` (`id`, `title`, `category_id`, `img_url`, `describes`, `content`, `number_people`) VALUES (10, '外交部：将妥善安排驻休斯敦总领馆人员', NULL, 'updata/16.jpg', '汪文斌：关于中国驻休斯敦总领馆馆员的有关情况，相信你已经从媒体上看到了。我这里要说的是，对于中国驻休斯敦总领馆的人员，中方将会作出妥善的安排。', '“国庆”“中秋”双节将至，据首都机场预测，9月28日至10月11日，首都机场计划起降航班1.43万架次，日均1021架次;运送旅客218.9万人次，日均15.64万人次。首都机场提醒，携带月饼坐飞机，需确认月饼礼盒内是否配有刀叉(包括塑料刀叉)或者红酒，以提前办理托运手续。', 3);
