INSERT INTO `political_video_learn` (`id`, `title`, `node_id`, `course_id`, `type`, `publisher`, `img_url`, `video_url`, `number_people`, `date_time`, `describes`) VALUES (2, '肖亚庆任工信部党组书记', 6, 1, '党建', '用户1', '/updata/img/02.jpg', '/updata/video/02.mp4', '123', '2020-10-13 11:37:44', '这次大会的主题是：不忘初心，牢记使命，高举中国特色社会主义伟大旗帜，决胜全面建成小康社会，夺取新时代中国特色社会主义伟大胜利，为实现中华民族伟大复兴的中国梦不懈奋斗。');
