INSERT INTO `political_video_learn` (`id`, `title`, `node_id`, `course_id`, `type`, `publisher`, `img_url`, `video_url`, `number_people`, `date_time`, `describes`) VALUES (4, '外交部：将妥善安排驻休斯敦总领馆人员', 7, 1, '党建', '用户1', '/updata/img/02.jpg', '/updata/video/04.mp4', '22', '2020-10-06 11:37:44', '承担着谋划决胜全面建成小康社会、深入推进社会主义现代化建设的重大任务，事关党和国家事业继往开来，事关中国特色社会主义前途命运，事关最广大人民根本利益');
