INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (1, '台媒：解放军分别从青海和浙江朝南海射两枚导弹，意在警告美国', '周二美国U-2高空侦察机一度闯进解放军北部战区实弹演习禁飞区活动，让中国国防部抗议，称美国在挑衅。昨天解放军则在南海进行反舰弹道导弹试射，美军出动侦察机进行侦搜。\r\n\r\n报道指出，解放军发射的是东风26B和东风21D导弹，意在警告美国。这两枚导弹分别从青海和浙江发射，朝向海南省和西沙群岛间的海域。\r\n\r\n先前海南海事局曾经宣布，24日到29日要在海南岛东南部海域进行军事训练，这两枚导弹都落入演习禁航区。\r\n\r\n《南华早报》引述消息人士的话说，这是回应美国最近频频对中国大陆的侦查行动，也藉由试射，吓阻其他想介入南海争议的势力，不希望邻国误会北京的意图。\r\n\r\n香港军事评论员宋中平认为，这明显是向美国释出讯息，表达就算是美国航舰，也不能在中国大陆近岸展现全部实力。', '/profile/cshi.jpg', '41', 1, 125, 200, 1, 0, '2020-10-12 16:00:09', '2020-10-12 16:00:21');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (2, '习近平向特朗普致慰问电', '国家主席习近平10月3日致电美国总统特朗普，就特朗普总统夫妇感染新冠病毒致以慰问。习近平在慰问电中表示，得知总统先生和梅拉尼娅女士感染新冠病毒，我和我夫人彭丽媛谨向你和你夫人表示慰问，祝你们早日康复。', '/profile/xweb.jpg', '41', 0, 222, 263, 1, 0, '2020-10-12 16:02:45', '2020-10-12 16:02:48');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (3, '肖亚庆任工信部党组书记', '日前，中共中央决定：肖亚庆同志任工业和信息化部党组书记，苗圩同志不再担任工业和信息化部党组书记。', '/profile/xwen1.jpg', '35', 0, 123, 150, 1, 0, '2020-10-12 16:04:37', '2020-10-12 16:04:40');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (4, '十九届五中全会定于今年10月召开', '中共中央政治局7月30日召开会议，决定今年10月在北京召开中国共产党第十九届中央委员会第五次全体会议，主要议程是，中共中央政治局向中央委员会报告工作，研究关于制定国民经济和社会发展第十四个五年规划和二〇三五年远景目标的建议。会议分析研究当前经济形势，部署下半年经济工作。中共中央总书记习近平主持会议', '/profile/cshi.jpg', '35', 0, 234, 256, 1, 0, '2020-10-12 16:05:38', '2020-10-12 16:05:40');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (5, '外交部：将妥善安排驻休斯敦总领馆人员', '汪文斌：关于中国驻休斯敦总领馆馆员的有关情况，相信你已经从媒体上看到了。我这里要说的是，对于中国驻休斯敦总领馆的人员，中方将会作出妥善的安排。', '/profile/xwen3.jpg', '36', 0, 258, 300, 1, 0, '2020-10-12 16:06:58', '2020-10-12 16:07:01');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (6, '民宿设计，再造空间之美', '近年来，伴随特色小镇、美丽乡村建设扎实推进，依托乡村闲置民居进行改造再利用的民宿业快速发展，民宿设计成为国内建筑领域的热点话题之一。一些乡村民宿经过设计改造，既保留了民居的古朴之美，亦适应了现代生活方式，在一定程度上带动了乡村整体发展。', '/profile/xwn4.jpg', '36', 1, 200, 210, 1, 0, '2020-10-12 16:30:49', '2020-10-12 16:30:51');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (7, '短视频唯流量走不远', '当前，短视频平台深入人们的日常生活，但部分网红为吸引用户点赞、转发、赚流量频出“奇招”，有的甚至突破法律红线。业内人士指出，优质内容才是网络平台健康发展的王牌，企图以突破底线来吸引眼球、换取流量的做法，于德不符、于法不容，这样的博主“走不好也走不远”。', '/profile/xwem5.jpg', '36', 0, 140, 188, 1, 0, '2020-10-12 16:31:29', '2020-10-12 16:31:32');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (8, '文创月饼：莫以文创之名过度包装', '距离中秋节还有不到10天，月饼也进入销售高潮。借着文创风的盛行，造型新颖、包装精美的文创月饼今年依然走俏。但记者发现，即便在倡导节俭的新风尚下，“小饼装大盒”的情形依然存在。', '/profile/xwens.jpg', '36', 0, 154, 220, 1, 0, '2020-10-12 16:32:19', '2020-10-12 16:32:21');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (9, '首都机场“十一”当日将迎旅客出港高峰', '“国庆”“中秋”双节将至，据首都机场预测，9月28日至10月11日，首都机场计划起降航班1.43万架次，日均1021架次;运送旅客218.9万人次，日均15.64万人次。首都机场提醒，携带月饼坐飞机，需确认月饼礼盒内是否配有刀叉(包括塑料刀叉)或者红酒，以提前办理托运手续。', '/profile/xwens.jpg', '36', 0, 123, 321, 1, 0, '2020-10-12 16:33:15', '2020-10-12 16:33:19');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (10, '看故宫与景德镇“同框”', '9月的故宫，新展连连。近日，由故宫博物院与景德镇市人民政府联合主办的“御瓷新见——景德镇明代御窑遗址出土与故宫博物院藏传世瓷器对比展”在景仁宫展出。196件(套)文物和瓷器标本，反映了明代御窑瓷器的辉煌艺术成就，为观众提供了全面了解明代景德镇御窑瓷器品种和欣赏标准器的机会。', '/profile/xwn4.jpg', '37', 0, 456, 654, 1, 0, '2020-10-12 16:34:02', '2020-10-12 16:34:05');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (11, '全国铁路10月上旬发送煤炭5031万吨', '中国国家铁路集团有限公司最新数据显示，全国铁路10月上旬发送煤炭5031万吨，主要港口、电厂存煤稳中有增。', '/profile/cshi.jpg', '37', 1, 201, 222, 1, 0, '2020-10-12 16:36:32', '2020-10-12 16:36:36');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (12, '我国北方地区明显降温 北方多地启动供暖', '近期，受冷空气频繁影响，我国北方地区明显降温，本周局地降温幅度可达8～10℃以上。北方多地陆续启动供暖工作暖人心。', '/profile/xweb.jpg', '37', 0, 124, 125, 1, 0, '2020-10-12 16:38:19', '2020-10-12 16:38:22');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (13, '罗云熙谴责跟车跟拍行为 望给自己留私人空间', '10月11日，罗云熙发文谴责越界的跟车、跟拍的行为，他写道：“尊重是互相的，麻烦给我留些私人空间。”', '/profile/xwem5.jpg', '38', 1, 321, 333, 1, 0, '2020-10-12 16:44:50', '2020-10-12 16:44:54');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (14, '杨威原创新作《余生》 表达全新人生感悟', '近日，杨威的最新单曲《余生》上线，该歌曲由其自己亲自操刀，包揽词曲制作人的全部工作，用磁性深情的嗓音诠释用情至深的思念。', '/profile/home1.png', '38', 0, 263, 300, 1, 0, '2020-10-12 16:45:51', '2020-10-12 16:45:53');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (15, '2020年戏曲百戏（昆山）盛典开幕', '10月11日，由文化和旅游部、江苏省政府主办的“2020年戏曲百戏（昆山）盛典”在昆山拉开帷幕。文化和旅游部党组成员、副部长李群到会致辞并宣布开幕，江苏省副省长马欣出席并致辞。', '/profile/home2.png', '38', 1, 258, 369, 1, 0, '2020-10-12 16:47:15', '2020-10-12 16:47:18');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (16, '这个黄金周让我们感受到了什么', '超过6亿人次出游、实现旅游收入4600多亿元、铁路单日发送旅客超1500万人次……伴随着这一组组数据，国庆中秋黄金周进入尾声。今年国庆中秋黄金周非比寻常：它是在我国应对新冠肺炎疫情付出巨大牺牲、取得重大战略成果背景下的一次全国范围内大流动，是对我国疫情防控水平的一次大检验，也是我国经济活力和消费潜力的一次充分展现，更让我们亲身感受到了中国人民家国一体的情怀和力量。', '/profile/home3.png', '39', 0, 147, 258, 1, 0, '2020-10-12 16:48:07', '2020-10-12 16:48:09');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (17, '培育中国式度假旅游产品的思考', '中西方在文明类型、文化模式、行为习惯、休闲偏好等方面的差异，决定了西式度假旅游产品在我国会有一定的市场，但不能从根本上替代本土化度假产品的开发。各级旅游度假区应结合自身禀赋和区域市场需求，谋划开发中国特色的度假产品，以更好地满足美好生活和优质旅游时代人们日益增长的度假需求', '/profile/home4.png', '39', 0, 159, 168, 1, 0, '2020-10-12 16:51:51', '2020-10-12 16:51:54');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (18, '长三角铁路国庆黄金周客发突破2600万人次', '　中新网上海10月9日电 (王子涛 许文峰)记者9日从中国铁路上海局集团有限公司获悉，9月28日至10月8日，长三角铁路国庆黄金周运输期间发送旅客突破2600万人次，达到2650.9万人次，占全国铁路旅客发送量21.4%，日均发送旅客241万，客发量恢复至去年同期的91%。10月1日发送旅客309.9万人次，创今年以来单日旅客发送量新高。', '/profile/timg.jpg', '39', 1, 123, 456, 1, 0, '2020-10-12 16:53:48', '2020-10-12 16:53:51');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (19, '租房补贴、学费补偿 大连这般推进高校毕业生就业创业', '大连高新技术产业园区人才中心副主任尹航介绍，只要具有全日制本科及以上学历，2018年1月1日以后毕业且自申请之日起毕业未满5年的新就业或自主创业高校毕业生，就可申请该补贴。同时，毕业生需要出示与大连市用人单位签约1年以上劳动合同或者自主创业的相关凭证等材料', '/profile/timg.jpg', '40', 0, 369, 380, 1, 0, '2020-10-12 16:54:55', '2020-10-12 16:54:57');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (20, '沈阳一老旧小区实现完美“逆袭”', '中新网沈阳9月25日电(记者 刘欢)“以前住在小区，从来不下楼，和邻居‘老死不相往来’；现在的院里非常有生气，居民有活力，邻里之间和谐、融洽，见面都是眉开眼笑的。”住在沈阳市和平新村社区的居民王永伟这样对记者说。', '/profile/home1.png', '40', 0, 147, 258, 1, 0, '2020-10-12 16:55:35', '2020-10-12 16:55:37');
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (22, '中国与世卫并肩抗疫，体现责任与担当', ' 本报讯（大连新闻传媒集团记者鹿道铭）昨日上午，由市政府外办组织成立的大连市外文公示语审核委员会举行专家委员聘任仪式暨座谈会，来自大连海事大学、大连民族大学、辽宁师范大学、大连工业大学、大连外国语大学、大连大学等高校的9名专家学者获聘为专家委员，他们将负责对我市主要街面、商铺及机场、火车站等重点涉外区域的英、日、韩公示语译审工作。', '/profile/zt.jpg', '48', 0, 0, 0, NULL, NULL, NULL, NULL);
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (23, '旨在实现标本兼治、归口管理', '外文公示语是城市公共信息导向系统的组成部分，是一座城市的名片，彰显城市的文化内涵，对促进对外经济文化交流起着尤为重要的作用。”据市政府外办工作人员介绍，近年来，我市各级政府和服务部门在外文公示语方面持续投入，充分体现了我市对来连外国友人安全与便利的关怀和关照。然而，在实际应用中，由于翻译水平参差不齐、译文质量缺乏管控，致使频遭吐槽的“神翻译”屡现街头，非但没有达到信息传递的语言服务目的，而且造成了“语言污染”，在一定程度上影响了我市对外交流的形象。有鉴于此，去年底，我市出台了《大连市外文公示语管理方案》，旨在实现标本兼治、归口管理、提高公示语终端译文质量，以及为社会提供标准公示语译品，同时不过度使用外文公示语。', '/profile/zt1.jpg', '48', 0, 0, 0, NULL, NULL, NULL, NULL);
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (24, '完善并规范环境保护', '市政府外办将逐步完善并规范环境保护、危机管理、安检防恐、无障碍设施、规约制度、应急救助等热点领域的公示语翻译；由外而内地渐次推进自然景观、文博陈列、历史名胜、文化遗产等解说性公示语的翻译、规范与应用。', '/profile/zt4.jpg', '48', 0, 0, 0, NULL, NULL, NULL, NULL);
INSERT INTO `press` (`id`, `title`, `content`, `img_url`, `press_category`, `is_recommend`, `like_number`, `views_number`, `user_id`, `press_status`, `create_time`, `update_time`) VALUES (25, '我市启动外文公示语管理规范工作', '  本报讯（大连新闻传媒集团记者鹿道铭）昨日上午，由市政府外办组织成立的大连市外文公示语审核委员会举行专家委员聘任仪式暨座谈会，来自大连海事大学、大连民族大学、辽宁师范大学、大连工业大学、大连外国语大学、大连大学等高校的9名专家学者获聘为专家委员，他们将负责对我市主要街面、商铺及机场、火车站等重点涉外区域的英、日、韩公示语译审工作。', '/profile/zt3.jpg', '48', 0, 0, 0, NULL, NULL, NULL, NULL);
INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (1, 2, 1, '台媒今日援引香港《南华早报》报道指出，解放军昨天(26日)上午朝南海发射两枚导弹，其中一枚是东风21D航母杀手反舰导弹，此举在于要对美国提出警告。', '2020-10-12 17:14:36', '2020-10-12 17:14:38');
INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (2, 3, 1, '国家主席习近平10月3日致电美国总统特朗普，就特朗普总统夫妇感染新冠病毒致以慰问。习近平在慰问电中表示，得知总统先生和梅拉尼娅女士感染新冠病毒，我和我夫人彭丽媛谨向你和你夫人表示慰问，祝你们早日康复。', '2020-10-12 17:14:54', '2020-10-12 17:14:56');
INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (3, 2, 2, '日前，中共中央决定：肖亚庆同志任工业和信息化部党组书记，苗圩同志不再担任工业和信息化部党组书记。', '2020-10-12 17:15:12', '2020-10-12 17:15:15');
INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (4, 2, 3, '中共中央政治局7月30日召开会议，决定今年10月在北京召开中国共产党第十九届中央委员会第五次全体会议，主要议程是，中共中央政治局向中央委员会报告工作，研究关于制定国民经济和社会发展第十四个五年规划和二〇三五年远景目标的建议。会议分析研究当前经济形势，部署下半年经济工作。中共中央总书记习近平主持会议', '2020-10-12 17:15:26', '2020-10-12 17:15:29');
INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (5, 2, 4, '汪文斌：关于中国驻休斯敦总领馆馆员的有关情况，相信你已经从媒体上看到了。我这里要说的是，对于中国驻休斯敦总领馆的人员，中方将会作出妥善的安排。', '2020-10-12 17:15:40', '2020-10-12 17:15:42');
INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (6, 2, 5, '近年来，伴随特色小镇、美丽乡村建设扎实推进，依托乡村闲置民居进行改造再利用的民宿业快速发展，民宿设计成为国内建筑领域的热点话题之一。一些乡村民宿经过设计改造，既保留了民居的古朴之美，亦适应了现代生活方式，在一定程度上带动了乡村整体发展。', '2020-10-12 17:15:53', '2020-10-12 17:15:56');
INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (7, 2, 6, '当前，短视频平台深入人们的日常生活，但部分网红为吸引用户点赞、转发、赚流量频出“奇招”，有的甚至突破法律红线。业内人士指出，优质内容才是网络平台健康发展的王牌，企图以突破底线来吸引眼球、换取流量的做法，于德不符、于法不容，这样的博主“走不好也走不远”。', '2020-10-12 17:16:06', '2020-10-12 17:16:09');
INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (8, 2, 7, '距离中秋节还有不到10天，月饼也进入销售高潮。借着文创风的盛行，造型新颖、包装精美的文创月饼今年依然走俏。但记者发现，即便在倡导节俭的新风尚下，“小饼装大盒”的情形依然存在。', '2020-10-12 17:20:02', '2020-10-12 17:20:04');
INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (9, 2, 8, '“国庆”“中秋”双节将至，据首都机场预测，9月28日至10月11日，首都机场计划起降航班1.43万架次，日均1021架次;运送旅客218.9万人次，日均15.64万人次。首都机场提醒，携带月饼坐飞机，需确认月饼礼盒内是否配有刀叉(包括塑料刀叉)或者红酒，以提前办理托运手续。', '2020-10-12 17:28:04', '2020-10-12 17:28:07');
INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (10, 2, 9, '9月的故宫，新展连连。近日，由故宫博物院与景德镇市人民政府联合主办的“御瓷新见——景德镇明代御窑遗址出土与故宫博物院藏传世瓷器对比展”在景仁宫展出。196件(套)文物和瓷器标本，反映了明代御窑瓷器的辉煌艺术成就，为观众提供了全面了解明代景德镇御窑瓷器品种和欣赏标准器的机会。', '2020-10-12 17:28:16', '2020-10-12 17:28:19');
INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (11, 2, 10, '中国国家铁路集团有限公司最新数据显示，全国铁路10月上旬发送煤炭5031万吨，主要港口、电厂存煤稳中有增。', '2020-10-12 17:28:31', '2020-10-12 17:28:32');
INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (12, 2, 11, '近期，受冷空气频繁影响，我国北方地区明显降温，本周局地降温幅度可达8～10℃以上。北方多地陆续启动供暖工作暖人心。', '2020-10-12 17:28:42', '2020-10-12 17:28:44');
INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (13, 2, 12, '10月11日，罗云熙发文谴责越界的跟车、跟拍的行为，他写道：“尊重是互相的，麻烦给我留些私人空间。”', '2020-10-12 17:28:53', '2020-10-12 17:28:57');
INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (14, 2, 13, '近日，杨威的最新单曲《余生》上线，该歌曲由其自己亲自操刀，包揽词曲制作人的全部工作，用磁性深情的嗓音诠释用情至深的思念。', '2020-10-12 17:29:07', '2020-10-12 17:29:09');
INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (15, 2, 14, '10月11日，由文化和旅游部、江苏省政府主办的“2020年戏曲百戏（昆山）盛典”在昆山拉开帷幕。文化和旅游部党组成员、副部长李群到会致辞并宣布开幕，江苏省副省长马欣出席并致辞。', '2020-10-12 17:29:18', '2020-10-12 17:29:20');
INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (16, 2, 15, '超过6亿人次出游、实现旅游收入4600多亿元、铁路单日发送旅客超1500万人次……伴随着这一组组数据，国庆中秋黄金周进入尾声。今年国庆中秋黄金周非比寻常：它是在我国应对新冠肺炎疫情付出巨大牺牲、取得重大战略成果背景下的一次全国范围内大流动，是对我国疫情防控水平的一次大检验，也是我国经济活力和消费潜力的一次充分展现，更让我们亲身感受到了中国人民家国一体的情怀和力量。', '2020-10-12 17:29:30', '2020-10-12 17:29:33');
