INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (25, 1, 1, '汪文斌：关于中国驻休斯敦总领馆馆员的有关情况，相信你已经从媒体上看到了。我这里要说的是，对于中国驻休斯敦总领馆的人员，中方将会作出妥善的安排。', '2020-10-27 14:56:03', NULL);
INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (26, 11, 3, '中共中央政治局7月30日召开会议，决定今年10月在北京召开中国共产党第十九届中央委员会第五次全体会议，主要议程是，中共中央政治局向中央委员会报告工作，研究关于制定国民经济和社会发展第十四个五年规划和二〇三五年远景目标的建议。会议分析研究当前经济形势，部署下半年经济工作。中共中央总书记习近平主持会议', '2020-10-27 15:06:13', NULL);
INSERT INTO `press_comment` (`id`, `user_id`, `press_id`, `content`, `create_time`, `update_time`) VALUES (27, 12, 1, '台媒今日援引香港《南华早报》报道指出，解放军昨天(26日)上午朝南海发射两枚导弹，其中一枚是东风21D航母杀手反舰导弹，此举在于要对美国提出警告。', '2020-10-27 15:57:31', NULL);
