INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (1, '台媒：解放军分别从青海和浙江朝南海射两枚导弹，意在警告美国', '台媒今日援引香港《南华早报》报道指出，解放军昨天(26日)上午朝南海发射两枚导弹，其中一枚是东风21D航母杀手反舰导弹，此举在于要对美国提出警告。', '123', 2, '2020-10-12 16:06:38');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (2, '习近平向特朗普致慰问电', '国家主席习近平10月3日致电美国总统特朗普，就特朗普总统夫妇感染新冠病毒致以慰问。习近平在慰问电中表示，得知总统先生和梅拉尼娅女士感染新冠病毒，我和我夫人彭丽媛谨向你和你夫人表示慰问，祝你们早日康复。', '123', 1, '2020-10-12 17:55:34');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (3, '肖亚庆任工信部党组书记', '日前，中共中央决定：肖亚庆同志任工业和信息化部党组书记，苗圩同志不再担任工业和信息化部党组书记。', NULL, 2, '2020-10-12 16:06:38');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (4, '十九届五中全会定于今年10月召开', '中共中央政治局7月30日召开会议，决定今年10月在北京召开中国共产党第十九届中央委员会第五次全体会议，主要议程是，中共中央政治局向中央委员会报告工作，研究关于制定国民经济和社会发展第十四个五年规划和二〇三五年远景目标的建议。会议分析研究当前经济形势，部署下半年经济工作。中共中央总书记习近平主持会议', NULL, 1, '2020-10-12 17:55:34');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (5, '外交部：将妥善安排驻休斯敦总领馆人员', '汪文斌：关于中国驻休斯敦总领馆馆员的有关情况，相信你已经从媒体上看到了。我这里要说的是，对于中国驻休斯敦总领馆的人员，中方将会作出妥善的安排。', NULL, 2, '2020-10-12 16:06:38');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (6, '民宿设计，再造空间之美', '近年来，伴随特色小镇、美丽乡村建设扎实推进，依托乡村闲置民居进行改造再利用的民宿业快速发展，民宿设计成为国内建筑领域的热点话题之一。一些乡村民宿经过设计改造，既保留了民居的古朴之美，亦适应了现代生活方式，在一定程度上带动了乡村整体发展。', NULL, 1, '2020-10-12 17:55:34');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (7, '短视频唯流量走不远', '当前，短视频平台深入人们的日常生活，但部分网红为吸引用户点赞、转发、赚流量频出“奇招”，有的甚至突破法律红线。业内人士指出，优质内容才是网络平台健康发展的王牌，企图以突破底线来吸引眼球、换取流量的做法，于德不符、于法不容，这样的博主“走不好也走不远”。', NULL, 2, '2020-10-12 16:06:38');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (8, '文创月饼：莫以文创之名过度包装', '距离中秋节还有不到10天，月饼也进入销售高潮。借着文创风的盛行，造型新颖、包装精美的文创月饼今年依然走俏。但记者发现，即便在倡导节俭的新风尚下，“小饼装大盒”的情形依然存在。', NULL, 1, '2020-10-12 17:55:34');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (9, '首都机场“十一”当日将迎旅客出港高峰', '“国庆”“中秋”双节将至，据首都机场预测，9月28日至10月11日，首都机场计划起降航班1.43万架次，日均1021架次;运送旅客218.9万人次，日均15.64万人次。首都机场提醒，携带月饼坐飞机，需确认月饼礼盒内是否配有刀叉(包括塑料刀叉)或者红酒，以提前办理托运手续。', NULL, 2, '2020-10-12 16:06:38');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (10, '看故宫与景德镇“同框”', '9月的故宫，新展连连。近日，由故宫博物院与景德镇市人民政府联合主办的“御瓷新见——景德镇明代御窑遗址出土与故宫博物院藏传世瓷器对比展”在景仁宫展出。196件(套)文物和瓷器标本，反映了明代御窑瓷器的辉煌艺术成就，为观众提供了全面了解明代景德镇御窑瓷器品种和欣赏标准器的机会。', NULL, 1, '2020-10-12 17:55:34');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (11, '全国铁路10月上旬发送煤炭5031万吨', '中国国家铁路集团有限公司最新数据显示，全国铁路10月上旬发送煤炭5031万吨，主要港口、电厂存煤稳中有增。', NULL, 2, '2020-10-12 16:06:38');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (12, '我国北方地区明显降温 北方多地启动供暖', '近期，受冷空气频繁影响，我国北方地区明显降温，本周局地降温幅度可达8～10℃以上。北方多地陆续启动供暖工作暖人心。', NULL, 1, '2020-10-12 17:55:34');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (13, '罗云熙谴责跟车跟拍行为 望给自己留私人空间', '10月11日，罗云熙发文谴责越界的跟车、跟拍的行为，他写道：“尊重是互相的，麻烦给我留些私人空间。”', NULL, 2, '2020-10-12 16:06:38');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (14, '杨威原创新作《余生》 表达全新人生感悟', '近日，杨威的最新单曲《余生》上线，该歌曲由其自己亲自操刀，包揽词曲制作人的全部工作，用磁性深情的嗓音诠释用情至深的思念。', NULL, 1, '2020-10-12 17:55:34');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (15, '2020年戏曲百戏（昆山）盛典开幕', '10月11日，由文化和旅游部、江苏省政府主办的“2020年戏曲百戏（昆山）盛典”在昆山拉开帷幕。文化和旅游部党组成员、副部长李群到会致辞并宣布开幕，江苏省副省长马欣出席并致辞。', NULL, 2, '2020-10-12 16:06:38');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (16, '这个黄金周让我们感受到了什么', '超过6亿人次出游、实现旅游收入4600多亿元、铁路单日发送旅客超1500万人次……伴随着这一组组数据，国庆中秋黄金周进入尾声。今年国庆中秋黄金周非比寻常：它是在我国应对新冠肺炎疫情付出巨大牺牲、取得重大战略成果背景下的一次全国范围内大流动，是对我国疫情防控水平的一次大检验，也是我国经济活力和消费潜力的一次充分展现，更让我们亲身感受到了中国人民家国一体的情怀和力量。', NULL, 2, '2020-10-12 16:06:38');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (17, '培育中国式度假旅游产品的思考', '中西方在文明类型、文化模式、行为习惯、休闲偏好等方面的差异，决定了西式度假旅游产品在我国会有一定的市场，但不能从根本上替代本土化度假产品的开发。各级旅游度假区应结合自身禀赋和区域市场需求，谋划开发中国特色的度假产品，以更好地满足美好生活和优质旅游时代人们日益增长的度假需求', NULL, 1, '2020-10-12 17:55:34');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (18, '长三角铁路国庆黄金周客发突破2600万人次', '　中新网上海10月9日电 (王子涛 许文峰)记者9日从中国铁路上海局集团有限公司获悉，9月28日至10月8日，长三角铁路国庆黄金周运输期间发送旅客突破2600万人次，达到2650.9万人次，占全国铁路旅客发送量21.4%，日均发送旅客241万，客发量恢复至去年同期的91%。10月1日发送旅客309.9万人次，创今年以来单日旅客发送量新高。', NULL, 2, '2020-10-12 16:06:38');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (19, '租房补贴、学费补偿 大连这般推进高校毕业生就业创业', '大连高新技术产业园区人才中心副主任尹航介绍，只要具有全日制本科及以上学历，2018年1月1日以后毕业且自申请之日起毕业未满5年的新就业或自主创业高校毕业生，就可申请该补贴。同时，毕业生需要出示与大连市用人单位签约1年以上劳动合同或者自主创业的相关凭证等材料', NULL, 1, '2020-10-12 17:55:34');
INSERT INTO `slideshow` (`id`, `img_title`, `img_desc`, `img_url`, `img_type`, `create_time`) VALUES (20, '沈阳一老旧小区实现完美“逆袭”', '中新网沈阳9月25日电(记者 刘欢)“以前住在小区，从来不下楼，和邻居‘老死不相往来’；现在的院里非常有生气，居民有活力，邻里之间和谐、融洽，见面都是眉开眼笑的。”住在沈阳市和平新村社区的居民王永伟这样对记者说。', NULL, 2, '2020-10-12 16:06:38');
