DROP VIEW IF EXISTS `bus_stop`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `bus_stop` AS select `bus_line_relation`.`lines_id` AS `lines_id`,`bus_line_relation`.`steps_id` AS `steps_id`,`bus_steps`.`name` AS `name`,`bus_line_relation`.`sequence` AS `sequence` from ((`bus_lines` left join `bus_line_relation` on((`bus_lines`.`id` = `bus_line_relation`.`lines_id`))) left join `bus_steps` on((`bus_steps`.`id` = `bus_line_relation`.`steps_id`)));

